INSERT INTO `tl_content` (`id`, `pid`, `ptable`, `sorting`, `tstamp`, `type`, `headline`, `text`, `addImage`, `singleSRC`, `alt`, `title`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `html`, `listtype`, `listitems`, `tableitems`, `summary`, `thead`, `tfoot`, `tleft`, `sortable`, `sortIndex`, `sortOrder`, `mooHeadline`, `mooStyle`, `mooClasses`, `highlight`, `shClass`, `code`, `url`, `target`, `titleText`, `linkTitle`, `embed`, `rel`, `useImage`, `multiSRC`, `orderSRC`, `useHomeDir`, `perRow`, `perPage`, `numberOfItems`, `sortBy`, `galleryTpl`, `playerSRC`, `youtube`, `posterSRC`, `playerSize`, `autoplay`, `sliderDelay`, `sliderSpeed`, `sliderStartSlide`, `sliderContinuous`, `cteAlias`, `articleAlias`, `article`, `form`, `module`, `protected`, `groups`, `guests`, `cssID`, `space`, `invisible`, `start`, `stop`, `com_order`, `com_perPage`, `com_moderate`, `com_bbcode`, `com_disableCaptcha`, `com_requireLogin`, `com_template`, `cslide_size`, `cslide_transition`, `cslide_transition_mode`, `cslide_duration`, `cslide_elem`, `cslide_autoplay`, `cslide_delay`, `cslide_addNavigation`, `cslide_addIndicator`, `cslide_slideleft`, `cslide_slideright`, `cslide_autoplayRandom`, `sc_name`, `sc_gap`, `sc_type`, `sc_gapdefault`, `sc_equalize`, `sc_color`, `sc_parent`, `sc_childs`, `sc_sortid`, `dk_cfsMultiSRC`, `dk_cfsSortBy`, `dk_cfsImageSize`, `dk_cfsFullsize`, `dk_cfsNumberOfItems`, `dk_cfsUseThumbnails`, `dk_cfsThumbnailsVisibleSelect`, `dk_cfsThumbnailSize`, `dk_cfsThumbnailsVisible`, `dk_cfsThumbnailsPosition`, `dk_cfsThumbnailsAlign`, `dk_cfsThumbnailsWidth`, `dk_cfsThumbnailsHeight`, `dk_cfsCarouFredSel`, `dk_cfsSynchronise`, `dk_cfsHtmlTpl`, `dk_cfsCssTpl`, `dk_cfsJsTpl`, `dk_cfsGalleryTpl`) VALUES ( 12, 33, 'tl_article', 128, 1387549676, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:6:"Praxis";}', '<p>Und auch wenn wir Sie in erster Linie nicht als[nbsp]„Kunden" sehen -[nbsp]<span style="color: #0064ae;">„König"</span> sind Sie bei uns trotzdem. Wir werden alles tun, um Ihnen den Aufenthalt bei uns so angenehm und unbeschwert wie möglich zu gestalten. Wenn Sie Wünsche oder Fragen - oder auch Kritik - sprechen Sie uns bitte an. Schenken Sie uns Ihr Vertrauen, wir sind immer für Sie da.</p>\n<p>Die Kernkompetenz unserer Praxis liegt im Bereich der<span style="color: #0064ae;"> zahnärztlichen Chirugie</span> sowie der <span style="color: #0064ae;">Implantologie</span>. Komplexere Fälle, die hohe Anforderungen an die fachliche und die ästhetische Ausführung stellen, sehen wir als Herausforderung.<br>Mit einem flexiblen Berhandlungskonzept wenden wir uns auch an Patienten, die wenig Zeit und hohe Ansprüche haben, und die durch ein perfektes Erscheinungsbild einen bleibenden Eindruck hinterlassen wollen.</p>\n<p>Eine unbeschwerte „Beauty- und Wellnessbehandlung" können wir Ihnen nicht versprechen.<br>Was wir Ihnen aber versprechen können, ist ein <span style="color: #0064ae;">engagierter fachlicher Einsatz für Ihre Gesundheit</span>.<br>Hierfür stellen wir Ihnen unsere Kompetenz aus fast 20 Jahren zahnmedizinischer Erfahrung und stetiger fachlicher Weiterbildung zur Verfügung. Die Anwendung moderner Behandlungsverfahren, unsere Ausstattung mit aktuellem technischen Equipment und die Einhaltung hoher Hygienestandards gewährleisten Ihnen die Sicherheit, die Sie als Patient erwarten dürfen.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:6:"praxis";i:1;s:4:"c33l";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', '', '', '', 1000, 'cslide_start', '', 3000, '', '', 'l', 'r', '', '', '0', '', '1', '', '', 0, '', 0, NULL, '', '', '', 0, '', '', '', 5, '', '', '', '', '', '', '', '', '', '' );
INSERT INTO `tl_content` (`id`, `pid`, `ptable`, `sorting`, `tstamp`, `type`, `headline`, `text`, `addImage`, `singleSRC`, `alt`, `title`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `html`, `listtype`, `listitems`, `tableitems`, `summary`, `thead`, `tfoot`, `tleft`, `sortable`, `sortIndex`, `sortOrder`, `mooHeadline`, `mooStyle`, `mooClasses`, `highlight`, `shClass`, `code`, `url`, `target`, `titleText`, `linkTitle`, `embed`, `rel`, `useImage`, `multiSRC`, `orderSRC`, `useHomeDir`, `perRow`, `perPage`, `numberOfItems`, `sortBy`, `galleryTpl`, `playerSRC`, `youtube`, `posterSRC`, `playerSize`, `autoplay`, `sliderDelay`, `sliderSpeed`, `sliderStartSlide`, `sliderContinuous`, `cteAlias`, `articleAlias`, `article`, `form`, `module`, `protected`, `groups`, `guests`, `cssID`, `space`, `invisible`, `start`, `stop`, `com_order`, `com_perPage`, `com_moderate`, `com_bbcode`, `com_disableCaptcha`, `com_requireLogin`, `com_template`, `cslide_size`, `cslide_transition`, `cslide_transition_mode`, `cslide_duration`, `cslide_elem`, `cslide_autoplay`, `cslide_delay`, `cslide_addNavigation`, `cslide_addIndicator`, `cslide_slideleft`, `cslide_slideright`, `cslide_autoplayRandom`, `sc_name`, `sc_gap`, `sc_type`, `sc_gapdefault`, `sc_equalize`, `sc_color`, `sc_parent`, `sc_childs`, `sc_sortid`, `dk_cfsMultiSRC`, `dk_cfsSortBy`, `dk_cfsImageSize`, `dk_cfsFullsize`, `dk_cfsNumberOfItems`, `dk_cfsUseThumbnails`, `dk_cfsThumbnailsVisibleSelect`, `dk_cfsThumbnailSize`, `dk_cfsThumbnailsVisible`, `dk_cfsThumbnailsPosition`, `dk_cfsThumbnailsAlign`, `dk_cfsThumbnailsWidth`, `dk_cfsThumbnailsHeight`, `dk_cfsCarouFredSel`, `dk_cfsSynchronise`, `dk_cfsHtmlTpl`, `dk_cfsCssTpl`, `dk_cfsJsTpl`, `dk_cfsGalleryTpl`) VALUES ( 13, 47, 'tl_article', 128, 1387542961, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:47:"Die gesamte zahnärztliche Chirugie und mehr...";}', '<p>Die Kernkompetenz unserer Praxis liegt in der<span class="blue"> zahnärztlichen Chirurgie</span> und der Implantologie. Hierbei führen wir ein breites Spektrum zahnärztlich-chirurgischer Maßnahmen ambulant durch. <br><br>Für umfassende Eingriffe haben wir zusätzlich die Möglichkeit, Ihnen in Verbindung mit dem Fachzentrum Dr. König GmbH ein <span class="blue">hochwertig ausgestattetes Patientenappartement</span> anzubieten. Hier können Sie nach aufwändigen Behandlungen entspannen oder für eine optimale Nachbetreuung auch über Nacht bleiben. Für unsere strukturierten <span class="blue">Just-In-Time Vollsanierungskonzepte</span>, aber auch für komplexe Fälle bietet Ihnen dieses Angebot eine Plattform für einen angenehmen Behandlungsablauf. Dank der guten Kooperation mit dem benachbarten St.-Elisabeth-Krankenhaus besteht auch für große chirurgische Behandlungen die Möglichkeit einer vollstationären Unterbringung.<br><br>Aufgrund unseres umfassenden Leistungsspektrums und unserer apparativen Ausstattung arbeiten wir mit vielen Kollegen in der Region sowie auch aus einem überregionalen Einzugsbereich zusammen. Sie überweisen uns ihre Patienten für spezielle chirurgische und implantologische Leistungen und führen die prothetische Versorgung im Anschluss selbst in ihrer Praxis durch. Im Rahmen dieses Kompetenznetzwerks nutzen auch viele Zahnärzte die Möglichkeit, in unseren Räumlichkeiten ihre Patienten unter Vollnarkose zu behandeln.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:4:"c33l";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', '', '', '', 1000, 'cslide_start', '', 3000, '', '', 'l', 'r', '', '', '0', '', '1', '', '', 0, '', 0, NULL, '', '', '', 0, '', '', '', 5, '', '', '', '', '', '', '', '', '', '' );
