alb legen wir auf dieses Thema sehr viel Wert und bedienen uns moderner technischer Einrichtungen. <br>Unsere Praxis verfügt über eine<span class="blue"> volldigitalisierte Röntgentechnologie</span> der aktuellen Generation, die für Sie die Strahlenexposition auf ein 1/8* vergleichbarer analoger Röntgengeräte reduziert. Hochauflösende Bildbearbeitungsprogramme ergeben gestochen scharfe Aufnahmen für eine exakte Befundung und Diagnosestellung. <br>Mit einem <span class="blue">3D-Volumentomographen (DVT)</span> der aktuellen Generation können wir eine hochpräzise dreidimensionale Darstellung aller gewünschter Strukturen im Kiefer- und Kopfbereich erstellen. Und dies bei einer auf 1/5** reduzierten Strahlenexposition im Vergleich zu herkömmlichen 3D-Röntgengeräten. Hierdurch können wir Verborgenes sichtbar und Schwieriges sicher machen.<br>Auf dieser verlässlichen Basis baut unser weiteres individuelles Behandlungskonzept für Sie auf.</p>\n<p>[nbsp]</p>\n<p class="blue">*[nbsp] basierend auf aktuellen Messungen der Firma J. Morita, Japan<br>** basierend auf aktuellen CTDIw-Wert Messungen der Firma J. Morita, Japan</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:4:"c33l";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', '', '', '', 1000, 'cslide_start', '', 3000, '', '', 'l', 'r', '', '', '0', '', '1', '', '', 0, '', 0, NULL, '', '', '', 0, '', '', '', 5, 'bottom', 'center', '', '', '', '', '', '', '', '' );
