fe und Implantationen schon im Vorfeld, am Bildschirm sehr genau planen können. Die genaue Kenntnis der Anatomie sichert nicht nur die <span class="blue">Schonung empfindlicher Strukturen</span> wie Nerven und Kieferhöhlen, sondern <span class="blue">macht Operationen kürzer, sicherer und schonender</span>.<br><br>Aus den vorhandenen Daten kann eine <span class="blue">Operations-Schablone</span> für die präzise Positionierung von Implantaten erstellt werden. Sie erlauben das exakte Setzen von Implantaten in <span class="blue">minimalinvasiver Vorgehensweise</span> – in geeigneten Fällen sogar ohne Skalpell und Vernähen.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:4:"c33l";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', '', '', '', 1000, 'cslide_start', '', 3000, '', '', 'l', 'r', '', '', '0', '', '1', '', '', 0, '', 0, NULL, '', '', '', 0, '', '', '', 5, 'bottom', 'center', '', '', '', '', '', '', '', '' );
