n. Was wir Ihnen aber versprechen können, ist ein<span class="blue"> engagierter fachlicher Einsatz für Ihre Gesundheit</span>. Hierfür stellen wir Ihnen unsere Kompetenz aus fast 20 Jahren zahnmedizinischer Erfahrung und stetiger fachlicher Weiterbildung zur Verfügung. Die Anwendung moderner Behandlungsverfahren, unsere Ausstattung mit aktuellem technischen Equipment und die dürfen.</p>\n<p><img title="Platzhalter" src="files/oc/images/ph.jpg" alt="Platzhalter" width="580" height="400"></p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '1', '', '', 'ascending', 0, '', '', '', '', 'com_default', '', '', '', 1000, 'cslide_start', '', 3000, '', '', 'l', 'r', '', '', '0', '', '1', '', '', 0, '', 0, NULL, '', '', '', 0, '', '', '', 5, 'bottom', 'center', '', '', '', '', '', '', '', '' );
